  "description": "Completed high school in Lindesberg in 1911, studied at Karolinska High School in Örebro 1914, at Uppsala University 1914-1916, at the Veterinary College 1916-1925, received a degree in veterinary medicine in 1922 and became a licensed veterinarian in 1925. Held various positions in Finspång, Linköping, Tjällmo, and Kopparberg from 1924-1929, district veterinarian in Jokkmokk in 1929, the same position in Röksberg the same year, and in Vetlanda since 1931, acting inspection veterinarian in Vetlanda and Sävsjö. Traveled to Germany, Switzerland, Hungary and other countries in 1937, 1938 and 1939, represented Sweden in Germany for the Red Cross in 1947. Wrote articles in newspapers and magazines.",
